import Cart from './components/pages/Cart'
function App() {
  return (
    <Router>
      <Header />
      <Routes>
      <Route path="/login">
          <Header onLogin={handleLogin} />
        </Route>
        <Route path="/profile">
          {isAuthenticated ? <Cart /> : <Navigate to="/login" />}
        </Route>      
        </Routes>
    </Router>
  );
}

export default App;
